const Axios = require('axios')
const Tesseract = require('tesseract.js')

// testing images and videos
const carsTest = require('../cameraFeed/carsTest.mp4')
const testPlate = require('./testPlate.jpg')
const testPlate1 = require('./testPlate1.jpg')
const testCars = require('./testCars.jpeg')
const cocoSsd = require('@tensorflow-models/coco-ssd')
const modelTest = require('./testingModel.jpg')
const securityTest = require('./security.mp4')

let video = document.createElement('VIDEO')
video.setAttribute('autoplay', 'true')
video.setAttribute('controls', 'controls')

video.src = securityTest

let canvas = document.createElement('canvas')
let context = canvas.getContext('2d')
context.globalCompositeOperation = 'difference'

let unrecognizedList = []

const sendImage = async() => {

    // get screenshot from current video 
    context.drawImage(video, 0, 0, 640, 480)
    let dataUrl = canvas.toDataURL()

    // load TensorFlow model
    const model = await cocoSsd.load()

    let currentFrame = new Image()
    currentFrame.src = modelTest
    currentFrame.width = 400
    currentFrame.height = 400

    let bufferCanvas = document.createElement('canvas')
    bufferCanvas.width = 400
    bufferCanvas.height = 400
    let bufferContext = bufferCanvas.getContext('2d')

    // classify image
    const predictions = await model.detect(currentFrame)

    console.log("Predictions: ", predictions.length ? predictions : 'nothing recognized')
    if(predictions.length){
        predictions.forEach((d) => {
            if(d.class === "car"){
            console.log(d.bbox)
            document.body.appendChild(currentFrame)

            const testImgDiv = document.createElement('div')
            testImgDiv.setAttribute('width', '400px')
            testImgDiv.setAttribute('height', '400px')
            testImgDiv.setAttribute('backgroundImage', modelTest)

            bufferContext.drawImage(currentFrame, 200, 200)
            document.body.appendChild(bufferCanvas)

            // document.body.appendChild(testImgDiv)
            }
        })
    }

    // Tesseract.recognize(
    //     testPlate,
    //     'eng'
    // ).then(({ data: { text }} ) => {
    //     console.log("Recognized text: ", text)
    // })

    // for each video in the current list of video endpoints

    // check db for the plate

    // if unrecognized, send to db and alert 

    let currentPlateNumber = '123456'

    // eventually changed to get unrecognized plates from db 

    if(!(unrecognizedList.includes(currentPlateNumber))){

        let response = Axios.post('/api/unrecognized/addUnrecognized', {
            plateNumber: currentPlateNumber
        })

        console.log(response)
        unrecognizedList.push(currentPlateNumber)
    }

    setTimeout(sendImage, 10000)
}   


module.exports = sendImage
